measurements.description:
Thirty-five slightly cupped flowers and one bud on three up to 56-cm inflorescences;
	sepals and petals apricot yellow, heavily blushed rose, striped darker rose;
	lip white, midline maroon stripe, maroon spots on edges, side lobes blushed yellow apically, keel yellow, speckled rose;
	column apricot yellow, speckled rose, anther cap white;
	substance firm; texture matte.
